import React from "react";
import {Link} from "react-router-dom";
import {connect} from "react-redux";
import {fetchMealItems} from "../../actions";

import DisplayItems from "../subcomponents/DisplayItems";

class OrderPage extends React.Component {
  render(){
    console.log(this.props);
    return(
      <div>
        <DisplayItems displayInfo={this.props.orderItems}/>
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return{orderItems: state.orderItems};
}

export default connect(mapStateToProps, {fetchMealItems})(OrderPage);
